import React from "react";
import {Buttons, TextBox, UploadButton} from "../../../shared/components/Buttons/Buttons";
import "../../.././assets/index.css";

const CreatePost = ()=>{

    return (
        <div className="createPost">
            <div className="createPost-text">
                <TextBox inputType="text" placeholder="Start Writing Post..."/>
            </div>
            <div className="createPost-buttons">
                <UploadButton />
                <Buttons value="Done"/>
            </div>
        </div>
    );
}

export default CreatePost;
